import React, { Component } from 'react';
import General from "./components/cvgeneral";
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      generalshow: false,
      edushow: false,
      workshow: false,
      generalin: {
        first: '',
        last: '',
        address: '',
        phone: '',
        email: '',
        role: '',
        description: '',
      },
      educationin: [{
        school: '',
        degree: '',
        start: '',
        end: '',
        location: '',
        description: '',
      }],
      workin: [{
        company: '',
        role: '',
        start: '',
        end: '',
        location: '',
        description: '',
      }],
      storedforms: {
        generalstore: '',
        educationstore: [],
        workstore: []
      }
    }
  }

  editClick(e) {
    let buttontype = e.target.id;
    let formtype;
    if (buttontype === "editgeneral") {
      formtype = document.getElementById("genform")
    }
    if (buttontype === "editeduc") {
      formtype = document.getElementById("eduformcontainer")
    }
    if (buttontype === "editwork") {
      formtype = document.getElementById("workformcontainer")
    }
    if (formtype.style.display === 'none') {
      formtype.style.display = "block";
    } else {
      formtype.style.display = "none";
    }
  }

  handleGenChange = (e) => {
    let newState = this.state.generalin;
    newState[e.target.id] = e.target.value;
    this.setState(newState);
  }

  onSubmitGen = (e) => {
    e.preventDefault();
    const generalstorecopy = [];
    generalstorecopy.push(this.state.generalin);
    this.setState({
      storedforms: {
      generalstore: generalstorecopy
      }
    })
  }


  render() {
    const { generalin, educationin, workin, storedforms } = this.state;
    return (
    <div className='cvapp'>
      <div className='formscontainer'>
        <form id="genform" onSubmit={this.onSubmitGen}>
          <div id="gentitle">General Information</div>
          <label htmlFor='first'>First Name</label>
          <input type="text" id="first" value={generalin.first} onChange={this.handleGenChange}></input>
          <label htmlFor='last'>Last Name</label>
          <input type="text" id="last" value={generalin.last} onChange={this.handleGenChange}></input>
          <label htmlFor='address'>Address</label>
          <input type="text" id="address" value={generalin.address} onChange={this.handleGenChange}></input>
          <label htmlFor='phone'>Phone</label>
          <input type="text" id="phone" value={generalin.phone} onChange={this.handleGenChange}></input>
          <label htmlFor='email'>Email</label>
          <input type="text" id="email" value={generalin.email} onChange={this.handleGenChange}></input>
          <label htmlFor='role'>Role</label>
          <input type="text" id="role" value={generalin.role} onChange={this.handleGenChange}></input>
          <label htmlFor='description'>Profile Description</label>
          <input type="textarea" id="description" value={generalin.description} onChange={this.handleGenChange}></input>
          <button type="submit" value="Submit">Submit</button>
        </form>
        <div id="eduformcontainer">
          <button id="eduadd" onClick={this.addEducation}>Add Education</button>
          <button id="edusubmit" type="submit" value="submit">Submit</button>
        </div>
        <div id="workformcontainer">
          <button id="workadd" onClick={this.addEducation}>Add Work</button>
          <button id="worksubmit" type="submit" value="submit">Submit</button>
        </div> 
      </div>
      <div className='editcontainer'>
        <button onClick={this.editClick} className='editbtn' id="editgeneral">Edit Info</button>
        <button onClick={this.editClick} className='editbtn' id="editeduc">Edit Education</button>
        <button onClick={this.editClick} className='editbtn' id="editwork">Edit Work</button>
      </div>
      <div id='resume'>
      <General generalstore={storedforms.generalstore} />
      </div>
    </div>
    )
  }

}

export default App;
